import React from "react";
import Square from "./squares/Square";
import classes from "./GameBoard.module.css";

const GameBoard = () => {
  return (
    <div className={classes.GameBoard}>
      <div className={classes.row}>
        <Square squareValue="0" />
        <Square />
        <Square />
      </div>
      <div className={classes.row}>
        <Square />
        <Square />
        <Square />
      </div>
      <div className={classes.row}>
        <Square />
        <Square />
        <Square />
      </div>
    </div>
  );
};

export default GameBoard;
